sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
//var domain = '8d5f136297d4d1501b243c100153afc9';
//var tbl_sysid = '400c5e974703011071459f78536d435d';

var domain = inputs.dsys_id;
var tbl = inputs.table_name;


var gr = new GlideRecord(tbl);
gr.addQuery('sys_domain',domain);
gr.query();
var count = gr.getRowCount();

outputs.rcount = count;
outputs.tablename = tbl;

})(inputs, outputs);

